import React, { Component } from "react";
import {Link, Switch, Route, BrowserRouter as Router } from "react-router-dom";
import AdminManageAccount from "./Components/AdminManageAccount";
import ViewJob from "./Components/viewJob/ViewJob";
import './App.css';

class App extends Component {
  render() {
    return (
      <Router>
        <div>
          <h1 className="header">Healthchecker Application</h1>
          <nav className="topnav">
              <Link to={'/'} className="nav-link">AdminManageAccount </Link>
          </nav>
          <Switch>
              <Route exact path='/' component={AdminManageAccount} />
          </Switch>
        </div>
      </Router>
    );
  }
}

export default App;
